// src/services/api.js
import axios from 'axios';

const API_URL = 'https://mybusiness.googleapis.com/v4'; // Base URL for Google My Business API

export const fetchGoogleReviews = async (token) => {
    const response = await axios.get(`${API_URL}/accounts/{accountId}/locations/{locationId}/reviews`, {
        headers: {
            Authorization: `Bearer ${token}`,
        },
    });
    return response.data;
};
